--Table creation

DROP TABLE booking;
DROP TABLE room;
Drop TABLE order_details;
Drop TABLE borrow_details;
Drop TABLE book_authors;
Drop TABLE orders;
Drop TABLE borrowings;
Drop TABLE publishers;
Drop TABLE authors;
Drop TABLE members;
Drop TABLE books;



CREATE TABLE publishers(
	publisherID 	CHAR(5) NOT NULL,	
	name 			VARCHAR(20),
	phoneNo 		VARCHAR(15) NOT NULL ,
	address 		VARCHAR(30),
	PRIMARY KEY(publisherID)
);

CREATE TABLE orders(
	orderID 		CHAR(5) NOT NULL, 
	publisherID		 CHAR(5),
	discount 		NUMBER(5,2),
	orderDate 	DATE DEFAULT sysdate,
	shippingMethod 	VARCHAR(20),
CONSTRAINT ChkShippingMethod CHECK(shippingMethod IN ('Standard Delivery', 'Oversea Delivery')),
	PRIMARY KEY(orderID),
	FOREIGN KEY(publisherID) REFERENCES publishers(publisherID)
);

CREATE TABLE books(
	bookID 		CHAR(5) NOT NULL,
	stockQuantity 	NUMBER(2),
	ISBN 			VARCHAR(20) UNIQUE,
	categories 	VARCHAR(20),
	language 		VARCHAR(20),
	PRIMARY KEY(bookID)
);

CREATE TABLE order_details(
	bookID 		CHAR(5),
	orderID 		CHAR(5),
	orderQty 		NUMBER(2),
	priceEach 		NUMBER(5,2),
	PRIMARY KEY(bookID,orderID),
	CONSTRAINT bookIDInOrderDetails FOREIGN KEY(bookID) REFERENCES books(bookID),
	CONSTRAINT orderIDInOrderDetails FOREIGN KEY(orderID) REFERENCES orders(orderID) 
);

CREATE TABLE authors(
	authorID 		CHAR(5) NOT NULL,
	name 			VARCHAR(20),
	country 		VARCHAR(20),
	gender 		CHAR(1),
	PRIMARY KEY(authorID)
);

CREATE TABLE book_authors(
bookID 		CHAR(5),
	authorID 		CHAR(5),
	CONSTRAINT COMP_NAME PRIMARY KEY(bookID, authorID)
);

CREATE TABLE members(
	memberID 		CHAR(5) NOT NULL,
	name 			VARCHAR(20),
	age			NUMBER(3),
	email 		VARCHAR(30) NOT NULL,
	phoneNumber	VARCHAR(15),
	registeredDate 	DATE DEFAULT sysdate,
	area      VARCHAR(30),
	status 		VARCHAR(15),
	CONSTRAINT ChkStatus CHECK (status IN ('Eligible', 'Not Eligible')),
	PRIMARY KEY(memberID)
);

CREATE TABLE borrowings(
	borrowingsID 	CHAR(5) NOT NULL,
	memberID 		CHAR(5),
	borrowQuantity 	NUMBER(1),
	dateBorrowed 	DATE DEFAULT sysdate, 
CONSTRAINT ChkBorrowQuantity
CHECK (borrowQuantity BETWEEN 1 and 3),
	PRIMARY KEY(borrowingsID),
	FOREIGN KEY(memberID) REFERENCES members(memberID)
);

CREATE TABLE borrow_details(
	bookID 		CHAR(5),
	borrowingsID 	CHAR(5),
	dateDue 		DATE,
	daysLate 		NUMBER(5) DEFAULT 0,
	totalFine 		NUMBER(7,2) DEFAULT 0,
	dateReturned  	DATE DEFAULT sysdate,
	CONSTRAINT bookIDInBorrowDetails FOREIGN KEY(bookID) REFERENCES books(bookID),
	CONSTRAINT borrowingsIDInBorrowDetails FOREIGN KEY(borrowingsID) REFERENCES borrowings(borrowingsID),
	CONSTRAINT borrow_details_COMP_NAME PRIMARY KEY(bookID, borrowingsID)
);

CREATE TABLE room(
    RoomID varchar(5),
    RoomType char,
    roomAvailable varchar(20),
    PRIMARY KEY(RoomID)
);

CREATE TABLE booking(
  BookingID       VARCHAR(5) NOT NULL,
  MemberID        VARCHAR(5),
  RoomID          VARCHAR(5),
  timeDateBook TIMESTAMP,
  bookDuration    NUMBER(1),
  timeDateEnd         TIMESTAMP DEFAULT sysdate,
  FOREIGN KEY(RoomID) REFERENCES room(RoomID),
  PRIMARY KEY (BookingID)
);

